const style = theme => ({
    container: {
      marginTop:"1rem",
    },
    HeaderTypo:{
      fontSize:theme.spacing(3),
      margin:theme.spacing(6),
      borderBottom:"2px solid #1e90ff"
    },
    textField:{
      width:"100%",
   },
   button:{
     marginTop:theme.spacing(3)
   }

  });

  export default style;
